import React from "react";

export default function Card(props) {
  let className = ["tiles-item"];
  className.push(props.className);

  return (
    <div className={className.join(" ")}>
      <div
        className={`tiles-item-inner ${props.hasShadow ? "has-shadow" : ""}`}
      >
        {props.children}
      </div>
    </div>
  );
}
